Doghi | 1995 | NFDC Classic | Marathi DVDRip | Phantom

Doghi (Two Females) is the story of Gauri and Krishna - two ordinary middle-class girls; who as their fate would have it fall into different circumstances in life. After her husband's fatal accident, Gauri comes to her poor brother in Bombay only to become a sex worker. Krishna tries to help her, but in vain.

